@SuppressWarnings("serial")
class Paint extends JFrame{
	String imgStr;
	public Paint(String imgStr[]){
	    super("Class Paint");         
	    setSize(800, 800);
	    setLayout(null);
	    setDefaultCloseOperation(JFrame.EXIT_ON_CLOSE);
	    this.imgStr = buildString(imgStr);
	}
	
	private String buildString(String imgArr[]){
		String imgStr = "";
		for(String img : imgArr)
			imgStr += img;
		return imgStr;
	}
	
	public void paint(Graphics g){
		super.paint(g);
		BufferedImage paintIMG = null;
		try{
			byte b[] = DatatypeConverter.parseBase64Binary(imgStr);
			InputStream in = new ByteArrayInputStream(b);
			paintIMG = ImageIO.read(in);
		}catch(Exception e){}
		if(paintIMG != null){
			Font font = new Font("Verdana", Font.BOLD, 15);
			RenderingHints renderingQuality = new RenderingHints(RenderingHints.KEY_TEXT_ANTIALIASING, RenderingHints.VALUE_TEXT_ANTIALIAS_GASP);
			Graphics2D imgGraphics = (Graphics2D)paintIMG.getGraphics();
			imgGraphics.setRenderingHints(renderingQuality);
			imgGraphics.setColor(new Color(0, 0, 0));
			imgGraphics.setFont(font);
			String xp = "3,291,192";
			String xph = "268,839";
			FontMetrics fm = imgGraphics.getFontMetrics(font);
			int width = fm.stringWidth(xp);
			imgGraphics.drawString(xp, 550 - width, 36);
			width = fm.stringWidth(xph);
			imgGraphics.drawString(xph, 550 - width, 56);
			imgGraphics.setColor(new Color(0, 255, 255));
			imgGraphics.drawString("5h 10m 20s", 115, 67);
			imgGraphics.drawString("95 (+1)", 145, 87);
			imgGraphics.drawString("1,938", 135, 107);
			imgGraphics.drawString("Idling.", 85, 128);
			g.drawImage(paintIMG, 10, 300, null);
		}
	}
}